import React from "react";
import "./Header.scss";
import { Link } from "react-router-dom";

function Header() {
  return (
    <React.Fragment>
      <div id="particles-js"></div>
      <script src="particles.js"></script>
      <header style={headerStyle}>
        <h1>
          <a style={aStyle} href="../">
            Ashkan's React App
          </a>
        </h1>
        <Link className="my-class" to="/sv">
          Sorting-Visualizer{" "}
        </Link>
        |{" "}
        <Link className="my-class" to="/covid19">
          Covid19-Tracker{" "}
        </Link>
        |{" "}
        <Link className="my-class" to="/covid_summary">
          Covid Summary{" "}
        </Link>
        |{" "}
        <Link className="my-class" to="/ml">
          DataScience Projects{" "}
        </Link>
      </header>
    </React.Fragment>
  );
}

const headerStyle = {
  background: "#333",
  color: "#fff",
  textAlign: "center",
  padding: "10px",
};

const linkStyle = {
  textDecoration: "none",
  ":hover": {
    textDecoration: "underline",
    fontWeight: "Bold",
  },
  ":active": {
    textDecoration: "underline",
    fontWeight: "Bold",
    color: "Blue",
  },
};
const aStyle = {
  color: "#fff",
  textDecoration: "none",
  ":hover": {
    textDecoration: "underline",
    fontWeight: "Bold",
    color: "Blue",
  },
  ":active": {
    textDecoration: "underline",
    fontWeight: "Bold",
    color: "Blue",
  },
};

export default Header;
